import React, { Component } from 'react'

 class UserItem extends Component {
    render() {
        var {user} = this.props;
        return (
            <tr>
                <td>{user.TaiKhoan}</td>
                <td>{user}</td>
                <td>New York</td>
                <td>27</td>
                <td>2011/01/25</td>
                <td>$112,000</td>
            </tr>
        )
    }
} 
export default UserItem;
